import images from "./images/images.jpg"
import img from "./images/img.png"
const data={
    productData:[
        {
           id:1,
           img:images,
           title:"S12",
           desc:"",
           price:12
        },
        {
            id:2,
            img:img,
            title:"burger",
            desc:"",
            price:15
         },
    ],
}
export default data;
